import App3 from '../assets/AppDesigns/MockupPhone_1.png';
import App4 from '../assets/AppDesigns/MockupPhone_1.png';

// WEB DESIGN
import Web1 from '../assets/AppDesigns/MockupPhone_1.png';

// BOOK COVERS
import Book1 from '../assets/AppDesigns/MockupPhone_1.png';

// APP DESIGN MAP
const appDesignsMap = {
  'src/assets/AppDesigns/MockupPhone_1.png': App1,
  'src/assets/AppDesigns/MockupPhone_1.png': App2,
  'src/assets/AppDesigns/MockupPhone_1.png': App3,
  'src/assets/AppDesigns/MockupPhone_1.png': App4,
};

// WEB DESIGN MAP
const webDesignsMap = {
  'src/assets/AppDesigns/MockupPhone_1.png': Web1,
};

// BOOK COVERS MAP
